import React, { useState, useEffect } from 'react';

// Helper function to export data to CSV
const exportToCSV = (data, filename = 'arbitrage_opportunities.csv') => {
  if (!data || data.length === 0) {
    console.warn("No data to export.");
    return;
  }

  const headers = Object.keys(data[0]).join(',');
  const rows = data.map(obj => Object.values(obj).join(','));
  const csvContent = "data:text/csv;charset=utf-8," + [headers, ...rows].join('\n');

  const encodedUri = encodeURI(csvContent);
  const link = document.createElement('a');
  link.setAttribute('href', encodedUri);
  link.setAttribute('download', filename);
  document.body.appendChild(link); // Required for Firefox
  link.click();
  document.body.removeChild(link); // Clean up
};

function Scanner() {
  const [opps, setOpps] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      setLoading(true);
      setError(null);
      try {
        // --- UPDATED: Request more pairs here ---
        const response = await fetch(
          'http://localhost:5000/api/arbitrage?pairs=' +
          'BTC-USDT,ETH-USDT,XRP-USDT,LTC-USDT,ADA-USDT,' +
          'SOL-USDT,DOT-USDT,DOGE-USDT,MATIC-USDT'
        );

        if (!response.ok) {
          throw new Error(`HTTP error! status: ${response.status}`);
        }
        const data = await response.json();
        setOpps(data);
      } catch (err) {
        console.error("Failed to fetch arbitrage opportunities:", err);
        setError("Failed to fetch data. Please ensure the backend server is running and accessible.");
      } finally {
        setLoading(false);
      }
    };

    // Fetch data initially and then every 30 seconds
    fetchData();
    const intervalId = setInterval(fetchData, 30000); // Fetch every 30 seconds

    return () => clearInterval(intervalId); // Cleanup on component unmount
  }, []);

  return (
    <div className="mb-4 bg-gray-700 p-6 rounded-md shadow-inner">
      <div className="flex flex-col md:flex-row justify-between items-center mb-4">
        <h2 className="text-2xl font-bold text-blue-300 mb-2 md:mb-0">Opportunities over 5%</h2>
        <button
          onClick={() => exportToCSV(opps)}
          className="bg-blue-600 hover:bg-blue-700 text-white font-semibold py-2 px-6 rounded-lg shadow-md transition duration-300 ease-in-out transform hover:scale-105 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-opacity-75"
        >
          Export CSV
        </button>
      </div>

      {loading && <p className="text-blue-300 text-center text-lg">Loading opportunities...</p>}
      {error && <p className="text-red-500 text-center text-lg">{error}</p>}

      {!loading && !error && (
        opps.length > 0 ? (
          <div className="overflow-x-auto">
            <table className="min-w-full bg-gray-800 border border-gray-600 rounded-lg">
              <thead className="bg-gray-700">
                <tr>
                  <th className="px-4 py-3 text-left text-xs font-medium text-gray-400 uppercase tracking-wider border-b border-gray-600">Pair</th>
                  <th className="px-4 py-3 text-left text-xs font-medium text-gray-400 uppercase tracking-wider border-b border-gray-600">Buy From</th>
                  <th className="px-4 py-3 text-left text-xs font-medium text-gray-400 uppercase tracking-wider border-b border-gray-600">Buy Price</th>
                  <th className="px-4 py-3 text-left text-xs font-medium text-gray-400 uppercase tracking-wider border-b border-gray-600">Sell To</th>
                  <th className="px-4 py-3 text-left text-xs font-medium text-gray-400 uppercase tracking-wider border-b border-gray-600">Sell Price</th>
                  <th className="px-4 py-3 text-left text-xs font-medium text-gray-400 uppercase tracking-wider border-b border-gray-600">Profit %</th>
                </tr>
              </thead>
              <tbody className="divide-y divide-gray-700">
                {opps.map((op, i) => (
                  <tr key={i} className="hover:bg-gray-750 transition-colors duration-200">
                    <td className="px-4 py-4 whitespace-nowrap text-sm font-medium text-blue-200">{op.pair}</td>
                    <td className="px-4 py-4 whitespace-nowrap text-sm text-gray-300">{op.buyExchange}</td>
                    <td className="px-4 py-4 whitespace-nowrap text-sm text-green-400">${parseFloat(op.buyPrice).toLocaleString()}</td>
                    <td className="px-4 py-4 whitespace-nowrap text-sm text-gray-300">{op.sellExchange}</td>
                    <td className="px-4 py-4 whitespace-nowrap text-sm text-red-400">${parseFloat(op.sellPrice).toLocaleString()}</td>
                    <td className="px-4 py-4 whitespace-nowrap text-sm font-semibold text-purple-400">{op.profitPercentage}%</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        ) : (
          <p className="text-gray-400 text-center text-lg">No arbitrage opportunities found. The market is efficient!</p>
        )
      )}
    </div>
  );
}

export default Scanner;
